#!/bin/sh
clear
arrD=('./file1.txt' 'file2.txt' './file3.txt' './file4.txt' './file5.txt' './file6.txt' './file7.txt' './file8.txt' './file9.txt' './file10.txt' './file11.txt' './file12.txt')
arrN=([1]='')
aa=0
for file in "${arrD[@]}"; do
	aa=$(($aa+1))
	base64 $file | gzip | base64 | zip >tmp${aa}.zip
	echo ${arrN[*]} | base64 -D | gunzip | base64 -D > tmp${aa}.jpg
	cat tmp${aa}.jpg tmp${aa}.zip >snap${aa}.jpg
	wait
	rm tmp${aa}.jpg tmp${aa}.zip
	bb=$(base64 snap${aa}.jpg)
	arrB+=("$bb")
	rm snap${aa}.jpg
done
echo "${#arrB[*]}"
aa=0
for file in "${arrB[@]}"; do
	aa=$(($aa+1))
	echo $file | base64 -D > snap${aa}.jpg
done
printf '%s\n' ""
exit 0
